import { Button, ButtonProps } from "@material-ui/core"
import { brand } from "../../constants/brand"

export const RccButton = ({children}: {children: any}) => {
    return (
      <Button 
        fullWidth
        color="primary"
        style={{
          backgroundColor: brand.palette.secondary.main,
          height: "50px"
        }}
      >
        {children}
      </Button>
    )
}
